"""
sort array by mergesort
"""
def mergeSort(lst):
    if len(lst)<=1:
        return lst
    def merge(lList,rList):
        tempList=[]
        while(lList and rList):
            if lList[0]<rList[0]:
                tempList.append(lList.pop(0))
            else:
                tempList.append(rList.pop(0))
        while(lList):
            tempList.append(lList.pop(0))
        while(rList):
            tempList.append(rList.pop(0))
        return tempList

    mid=len(lst)/2
    left=mergeSort(lst[:mid])
    right=mergeSort(lst[mid:])
    return merge(left,right)

