"""
single linklist sort by mergesort
"""
class ListNode:
    def __init__(self, x):
        self.val = x
        self.next = None


class Solution:
    # @param head, a ListNode
    # @return a ListNode
    def sortList(self, head):
        if not head or not head.next:
            return head

        def merge(lHead,rHead):
            def newNode(p,node):
                p.next=node
                node=node.next
                p=p.next
                p.next=None
                return p,node

            newHead=ListNode(0)
            p=newHead
            while(lHead and rHead):
                if lHead.val<=rHead.val:
                    p,lHead=newNode(p,lHead)
                else:
                    p,rHead=newNode(p,rHead)
            while(lHead):
                p,lHead=newNode(p,lHead)
            while(rHead):
                p,rHead=newNode(p,rHead)
            p=newHead
            newHead=newHead.next
            p.next=None
            return newHead

        head1,head2=self.splitList(head)
        left=self.sortList(head1)
        right=self.sortList(head2)
        return merge(left,right)

    #split the list to 2 part
    def splitList(self,head):
        p=head
        q=p
        while(q):
            q=q.next
            if not q:
                tp=p
                p=p.next
                tp.next=None
                break
            q=q.next
            if not q:
                tp=p
                p=p.next
                tp.next=None
                break
            p=p.next
        return head,p


